snippet.description:
A big update is coming to Monster Hunter Online on January 26th, featuring Shen Gaoren and Gunlances!

Shen Gaoren will be a big 12 Hunter hunt to take down the giant Carapaceon.

There's also a bunch of new fashion gear, but chances are they'll be from the cash shop.

Originally from;
http://v.17173.com/

